package com.highstreets.user.models;import com.google.gson.annotations.SerializedName;public class deals_model {    @SerializedName("merchant_id")    private String MerchantID;    @SerializedName("business_name")    private String BusinessName;    @SerializedName("category")    private String CategoryID;    @SerializedName("city")    private String CityName;    @SerializedName("deal_of_day")    private String DealOfTheDay;    @SerializedName("deal_date")    private String DealDate;    @SerializedName("image")    private String DealImage;    @SerializedName("offer_percentage")    private String OfferPercentage;    @SerializedName("mrp_price")    private String MRP_Price;    @SerializedName("offer_price")    private String OffePrice;    public String getMerchantID() {        return MerchantID;    }    public void setMerchantID(String merchantID) {        MerchantID = merchantID;    }    public String getBusinessName() {        return BusinessName;    }    public void setBusinessName(String businessName) {        BusinessName = businessName;    }    public String getCategoryID() {        return CategoryID;    }    public void setCategoryID(String categoryID) {        CategoryID = categoryID;    }    public String getCityName() {        return CityName;    }    public void setCityName(String cityName) {        CityName = cityName;    }    public String getDealOfTheDay() {        return DealOfTheDay;    }    public void setDealOfTheDay(String dealOfTheDay) {        DealOfTheDay = dealOfTheDay;    }    public String getDealDate() {        return DealDate;    }    public void setDealDate(String dealDate) {        DealDate = dealDate;    }    public String getDealImage() {        return DealImage;    }    public void setDealImage(String dealImage) {        DealImage = dealImage;    }    public String getOfferPercentage() {        return OfferPercentage;    }    public void setOfferPercentage(String offerPercentage) {        OfferPercentage = offerPercentage;    }    public String getMRP_Price() {        return MRP_Price;    }    public void setMRP_Price(String MRP_Price) {        this.MRP_Price = MRP_Price;    }    public String getOffePrice() {        return OffePrice;    }    public void setOffePrice(String offePrice) {        OffePrice = offePrice;    }}